import React, { useState } from "react";
import '../assets/styles/CareerBento.scss';

const CareerBento = () => {
  const [activeHistory, setActiveHistory] = useState(0);

  const history = [
    {
      org: "KLAW INDUSTRIES",
      role: "Software Engineer Intern",
      period: "2024 — 2025",
      impact: "AUG 2024 - MAY 2025",
      bullets: [
      "Cut equipment diagnostic time from 1 day to 1 hour by unifying real-time metrics across AWS IoT Core and Timestream, through the engineering of a centralized backend system integrated with Arduino sensors.",
      "Achieved fault-tolerant video telemetry by automating Python ingestion workflows via systemd for 10+ IP cameras, through the implementation of self-healing streaming protocols that persist during network disruptions.",
      "Shortened cross-functional troubleshooting time by 25% by integrating machine data and video streams into a unified Grafana dashboard, through the leveraging of AWS IoT TwinMaker to visualize real-time factory performance."],
      tools: ["AWS IOT CORE", "PYTHON", "KINESIS"],
      image: "https://images.squarespace-cdn.com/content/v1/5cfee7779de45a000197fd31/1622649420794-QC687JBOL698CEBAZOTH/KLAW+Industries+Transparent.png"
    },
    {
      org: "BINGHAMTON UNIVERSITY",
      role: "MS in Computer Science",
      period: "2023 — 2025",
      impact: "AUG 2023 - MAY 2025",
      details: "Advanced study in Cloud Computing and Distributed Systems. Served as a Graduate Assistant, supporting departmental engineering initiatives.",
      tools: ["CLOUD COMPUTING", "DISTRIBUTED SYSTEMS", "NETWORK SECURITY", "DESIGN PATTERNS"],
      image: "https://upload.wikimedia.org/wikipedia/en/6/67/State_University_of_New_York_at_Binghamton_Seal.png"
    },
    {
      org: "LTIMINDTREE",
      role: "Software Engineer",
      period: "2021 — 2023",
      impact: "JUN 2021 - JUL 2023",
      details: "Optimized large-scale financial accounting services and migrated legacy PL/SQL logic into modern rule engines.",
      tools: ["JAVA", "SPRING BATCH", "SQL"],
      image: "https://companieslogo.com/img/orig/LTIM.NS-dea59dc6.png?t=1720244492"
    },
    {
      org: "UNIVERSITY OF MUMBAI",
      role: "BTech in Information Technology",
      period: "2017 — 2021",
      impact: "AUG 2017 - MAY 2021",
      details: "Led the Alumni Cell Social Media team and served as Senior Photographer. Published research on Automated Systems while mastering core IT principles.",
      tools: ["DATA STRUCTURES", "ALGORITHMS", "DATABASE MGMT", "OPERATING SYSTEMS"],
      image: "https://kjsce.somaiya.edu/assets/kjsce/img/newlogo/kjsce-formerly.svg"
    }
  ];

  return (
    <section className="career-bento-section" id="career">
      <div className="bento-container">
        <header className="bento-header">
          <p className="subtitle">LATEST NEWS</p>
          <h2 className="main-title">CAREER ENGINEERING</h2>
        </header>

        <div className="bento-grid">
          {/* LEFT SIDE: Interactive Experience Tabs */}
          <div className="tabs-column">
            {history.map((item, index) => (
              <div 
                key={index}
                className={`career-tab ${activeHistory === index ? 'active' : ''}`}
                onMouseEnter={() => setActiveHistory(index)}
              >
                {/* This is the orange connector that overlaps the right panel */}
                <div className="active-connector"></div>

                <div className="tab-content">
                  <span className="tab-org">{item.org}</span>
                  <h3 className="tab-role">{item.role}</h3>
                  <p className="tab-preview">{item.impact}</p>
                </div>
                <div className="tab-arrow">↗</div>
              </div>
            ))}
          </div>

          {/* RIGHT SIDE: Detailed Experience View */}
          <div className="detail-column">
            <div className="detail-visual-box" key={activeHistory}>
              <div className="detail-header-row">
                <span className="detail-period">{history[activeHistory].period}</span>
                <img src={history[activeHistory].image} alt="Org Logo" className="detail-logo" />
              </div>

              <div className="detail-text-content">
                <h2 className="detail-org-full">{history[activeHistory].org}</h2>
                <p className="detail-description">{history[activeHistory].details}</p>

                <div className="stack-group">
                  {history[activeHistory].tools.map(tool => (
                    <span key={tool} className="tool-tag">{tool}</span>
                  ))}
                </div>
              </div>
              <div className="vertical-label">TELEMETRY_SCAN</div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CareerBento;
